oxy_webhelp_navlinks = {"aws_evaluate_sla_option-d22908e12631":{"topics":[{"title":"Primary snapshot retention for AWS workloads","shortdesc":"<p class=\"shortdesc\">Primary snapshot retention for AWS workloads ensures data protection and         recoverability by allowing you to set various retention policies. These policies include         retaining hourly, daily, monthly, and yearly snapshots to meet compliance, business         continuity, and disaster recovery requirements.<\/p>","href":"saas\/aws_primary_snapshot_retention.html","attributes":{"data-id":"aws_primary_snapshot_retention"},"menu":{"hasChildren":false},"tocID":"aws_primary_snapshot_retention-d22908e12642","topics":[]},{"title":"Retention lock for AWS workloads","shortdesc":"<p class=\"shortdesc\">A retention lock on an SLA Domain is a security feature that prevents premature         deletion of AWS snapshots.<\/p>","href":"saas\/aws_retention_lock.html","attributes":{"data-id":"aws_retention_lock"},"menu":{"hasChildren":false},"tocID":"aws_retention_lock-d22908e12653","topics":[]},{"title":"Archiving for AWS workloads ","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> supports archival of Amazon EC2 instance or EBS volume and Amazon         RDS PostgreSQL database snapshots to lower-cost storage, ensuring cost savings, compliance,         and security. <\/p>","href":"saas\/aws_archiving.html","attributes":{"data-id":"aws_archiving"},"menu":{"hasChildren":false},"tocID":"aws_archiving-d22908e12664","topics":[]},{"title":"Multiple archival locations for AWS workloads","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> supports SLA Domains with multiple archival locations for Amazon         EC2 instances<span class=\"ph\">, EBS volumes,             and Amazon RDS PostgreSQL database instances<\/span>, allowing granular control over data         archiving with up to two distinct archiving policies.<\/p>","href":"saas\/aws_multiple_arch_loc.html","attributes":{"data-id":"aws_multiple_arch_loc"},"menu":{"hasChildren":false},"tocID":"aws_multiple_arch_loc-d22908e12677","topics":[]},{"title":"Backup location for Amazon S3","shortdesc":"<p class=\"shortdesc\">The Amazon S3 backup location is an S3 bucket used to store scheduled backups of your         source bucket. It supports various storage classes to optimize costs and ensures data         immutability with Object Lock and Versioning features.<\/p>","href":"amazon_S3\/aws_s3_backup_location.html","attributes":{"data-id":"aws_s3_backup_location"},"menu":{"hasChildren":false},"tocID":"aws_s3_backup_location-d22908e12693","topics":[]},{"title":"Cross-account snapshot replication for Amazon EC2 instances","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> supports cross-account and cross-region replication of Amazon EC2         instance or EBS volume snapshots to ensure that all snapshots are available during disaster         recovery or when the original snapshot is deleted or corrupted.<\/p>","href":"saas\/snapshot_replication_aws.html","attributes":{"data-id":"snapshot_replication_aws"},"menu":{"hasChildren":false},"tocID":"snapshot_replication_aws-d22908e12704","topics":[]},{"title":"Cross-account snapshot replication and export for Amazon RDS","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> supports replication and export of Amazon RDS snapshots to         another AWS account to ensure that all snapshots are available during disaster recovery or         when the original snapshot is deleted or corrupted.<\/p>","href":"saas\/aws_rds_cross_account_replication.html","attributes":{"data-id":"aws_rds_cross_account_replication"},"menu":{"hasChildren":false},"tocID":"aws_rds_cross_account_replication-d22908e12717","next":"aws_rds_cross_account_replication-d22908e12717"},{"title":"Continuous backups for Amazon RDS ","shortdesc":"<p class=\"shortdesc\">To capture all changes in data and transaction logs for Amazon RDS and Aurora         databases, you can enable continuous backups for point-in-time recovery using <span class=\"ph\">RSC<\/span> or the AWS management Console.<\/p>","href":"saas\/aws_rds_continuous_backups.html","attributes":{"data-id":"aws_rds_continuous_backups"},"menu":{"hasChildren":false},"tocID":"aws_rds_continuous_backups-d22908e12741","topics":[]},{"title":"Continuous Data Protection-only SLA Domains for Amazon RDS","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> workloads, such as Amazon RDS, support both continuous data         backup and scheduled backups. You can enable them as needed. With Continuous Data         Protection-only SLA Domains, you can exclude snapshot schedules for supported workloads by         turning off the frequency and retention when creating or editing the Continuous Data         Protection-only SLA Domains.<\/p>","href":"saas\/sla_domains_without_snapshot_schedules_2.html","attributes":{"data-id":"sla_domains_without_snapshot_schedules"},"menu":{"hasChildren":false},"tocID":"sla_domains_without_snapshot_schedules-d22908e12755","topics":[]},{"title":"Continuous backups PITR for Amazon DynamoDB","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> configures and relies on native Point-in-Time Recovery associated         with Amazon DynamoDB for continuous backup of source tables.<\/p>","href":"saas\/aws_dynamodb_continuous_backup_pitr.html","attributes":{"data-id":"aws_dynamodb_continuous_backup_pitr"},"menu":{"hasChildren":false},"tocID":"aws_dynamodb_continuous_backup_pitr-d22908e12768","topics":[]},{"title":"Region-specific backups for DynamoDB","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> automatically selects a region to take a backup of Amazon         DynamoDB global tables and stores the snapshot in that selected region.<\/p>","href":"saas\/aws_dynamodb_regn_specific_backups.html","attributes":{"data-id":"aws_dynamodb_regn_specific_backups"},"menu":{"hasChildren":false},"tocID":"aws_dynamodb_regn_specific_backups-d22908e12782","topics":[]},{"title":"Regional S3 backup repository for DynamoDB","shortdesc":"<p class=\"shortdesc\">Rubrik provisions a dedicated Amazon S3 bucket in the same AWS region as the source         Amazon DynamoDB table for the backup process.<\/p>","href":"saas\/aws_dynamodb_regn_s3_backup_repo.html","attributes":{"data-id":"aws_dynamodb_regn_s3_backup_repo"},"menu":{"hasChildren":false},"tocID":"aws_dynamodb_regn_s3_backup_repo-d22908e12795","topics":[]}]}};